+
+  static const userPayload = "user_payload";
+  static const userLogin = "user_login";
+
+  static void showHUD({String status = "loading ...."}) async {
+    await Future.delayed(const Duration(milliseconds: 1));
+    EasyLoading.show(status: status);
+  }
+
+  static void hideHUD(){
+    EasyLoading.dismiss();
+  }
